    public class func drawPackBackgroundMask(frame frame: CGRect = CGRect(x: 0, y: 0, width: 750, height: 439), color: UIColor = UIColor(red: 0.095, green: 0.095, blue: 0.095, alpha: 1.000)) {

        //// path Drawing
        let pathPath = UIBezierPath()
