        pathPath.addLineToPoint(CGPoint(x: frame.minX + 1.00000 * frame.width, y: frame.minY + -0.00000 * frame.height))
        pathPath.addLineToPoint(CGPoint(x: frame.minX + 1.00000 * frame.width, y: frame.minY + 0.65976 * frame.height))
        pathPath.addLineToPoint(CGPoint(x: frame.minX + 0.00000 * frame.width, y: frame.minY + 1.00000 * frame.height))
        pathPath.addLineToPoint(CGPoint(x: frame.minX + 0.00000 * frame.width, y: frame.minY + -0.00000 * frame.height))
